message:
Better #navmenu

1- min-width instead of width for spanding menu;
2- "File", "Feedback", "Settings" and "About" tabs;
3- Renamed "Home" to "View" button;
4- Moved "Changelog" and "Upcomming features" buttons to "About" tab;
5- Changed #navmenu's CSS color propertie;
6- Tabs menus from "About" menu moved to "About" tab;
7- New popunder for "About" tab (Credits popunder);
8- Changed #navmenu's <h1>, <h2> and <span> size;
9- Changed #navmenu's tabs menu margin;

I take this inspiration after observating the menu organization of
GameBoy Online by Grant Galitz (with File, View, Settings and About
buttons).

Added "Comming features" menu

Isn't very friendly yet, because:
1- Can't return to main menu;
2- Don't have an container for scrolling;
3- Don't support mobile resolution;
4- With an scrollbar because 60px magin;

Soon I'll improve it. :+1:
